  const [error, setError] = useState('')

  return (
    <Card>
      <TYPE.H2>Buy Master Token</TYPE.H2>
      <BuyInputs />
      <Button disabled={error}>Preview Trade</Button>
    </Card>
  );
};

export default SwapCard;
